We use ARM GNU Toolchain which contains the GNU C/C++ Compiler (GCC), Assembler, Linker and various utilities (referred to as binutils). The compiler that we use to compile our C files is: aarch64-none-elf-gcc . Let us now start with the Hello World example that we used in the Programming in C section and understand how the above steps are performed. Here is the code: #include "uart.h"
void main() { uart_puts("Hello World");
} Readers can follow along by executing the commands specified in this section. The directory to work in is at: exercises/c_functions/hello_world_example.c The first line of the above code starts with "#include" directive. This directive tells the preprocessor (which is the first pass of the compiler) to insert the contents of another file into the source code at the point where the #include directive is found. Include directives are typically used to include the C header files for C functions that are held outside of the current source file. We use it in our program to make use of the uart_puts() function declared within uart.h file. The uart.h file is located at the exercises/include/ directory. Step 1: Use this command to compile the above hello_world_example.c file: aarch64-none-elf-gcc -ffreestanding -g -nostdinc -nostdlib -nostartfiles -I../include/ \
-c hello_world_example.c -o hello_world_example.o To compile our code we use the compiler aarch64-none-elf-gcc followed by a series of options and a list of files to be compiled. aarch64-none-elf-gcc <list of options> <list of files> Options are used to control the behavior of the compiler and all of them start with a hyphen followed by one or more alphanumeric characters. While aarch64-none-elf-gcc supports many of them, only few options will be needed by us. If you are curious to learn about all of the options you can run the command below to list them all: aarch64-none-elf-gcc -v --help The following table provides details and purpose of the options used by the above command line. Compiler Option Description -o <file> Place the output in <file>. This will be the name and path of generated object files -I <dir> Add <dir> to the to list of directories to be searched for include files -c Compile and assemble the C file, but do not link -ffreestanding Indicate that the file should be compiled for a freestanding, not a hosted, environment. A freestanding environment is one in which the standard library may not exist, and program startup may not be at symbol "main" -g Generate debug information in generated object files -nostdinc Do not search the standard system directories or builtin directories for include files -nostdlib Do not link with standard C libraries -nostartfiles Do not use the standard system startup files when linking This command produces object file hello_world_example.o. The option -ffreestanding is used to specify that the code would be run directly on hardware and there is no underlying operating system support. As there is no operating system support, the application will have to be self-contained. We need to provide all the suporting code ourselves and cannot rely on standard C libraries and include files. We use the options -nostdinc -nostdlib -nostartfiles to tell the compiler not to make use of any standard include files, libraries or start files. The step above has created the object file hello_world.o. Now the GNU linker can be used to create the executable file from object files created by compiler. The GNU linker can be invoked using command aarch64-none-elf-ld . Step 2: Use this command to generate hello_world_example.elf file using the hello_world_example.o object file that we produced using step 1: aarch64-none-elf-ld -nostdlib -nostartfiles -T link.ld -o hello_world_example.elf start.o hello_world_example.o ../common/uart.o The usage syntax of aarch64-none-elf-ld is similar to aarch64-none-elf-gcc . aarch64-none-elf-ld <list of options> <list of object files> The -nostdlib -nostartfiles options tell the linker not to link with standard C library or use standard start files while producing the executable. A linker script link.ld is passed to exercise greater control over the linking process. As you can notice in the above command, we use two more object files start.o and uart.o in the above command to produce the final executable. File start.o contains the code to boot the CPU and hand over the control to main function. The boot process involved initialization and configuration of various system registers, general purpose registers and memory. We will explain more about the boot process in a Part-2 of this book. We run the generated executable using a free and open-source emulator named QEMU . It can emulate a set of different hardware and device models. As QEMU requires the file to be executed in binary file format, we convert the ELF file to binary file using aarch64-none-elf-objcopy utility by running following command: Step 3: Use this command to convert the ELF file to binary file: aarch64-none-elf-objcopy -O binary hello_world_example.elf kernel8.img The above command will produce a binary image named kernel.img. Step 4: Use this command to run kernel.img file using QEMU: qemu-system-aarch64 -M raspi3 -kernel kernel8.img -serial null -serial stdio -nographic

