Here is the code for if-else statement example from C language syntax section: #include "uart.h" int main()
{ int lower_int_val = find_lower_int(2, 6); uart_print_num(lower_int_val);
} // function returns the lower of two integers
int find_lower_int(int x, int y) { if (x <= y) { // if the value of x is less than or equal to y // execute the code in this block return x; } else { // if the condition above is false // execute code in this block return y; }
} Path of example: exercises/c_functions/if_else_example.c The command for compiling if_else_example.c file is: aarch64-none-elf-gcc -O0 -ffreestanding -nostdinc -nostdlib -nostartfiles -I../include/ \
-c if_else_example.c -o if_else_example.o The -O0 option in the above command tells compiler not to optimize the code. The compiler optimization tries to improve the generated assembly code by making it consume fewer resources (compile time, memory space etc) so that it will result in faster-running machine code. We disable optimization here to make it easier to relate the C statements with the disassembly. Compiler supports different levels for optimization from -O0 to -O3 . -O0 completly disables optimization and -O3 performs maximum amount of optimization. The linker command to produce final executable for this example is: aarch64-none-elf-ld -nostdlib -nostartfiles start.o if_else_example.o ../common/uart.o -T link.ld -o if_else_example.elf For generating disassembly for examples in this chapter we will an add option --source to objdump command. Turning on this switch tells it to interleave source code with disassembly. This would help in associating C lines with assembly. Here is the full command to produce the disassembly output for this example: aarch64-none-elf-objdump --source -d if_else_example.o > if_else_example.disass Let us now look at the output in more detail in small logical blocks. We will start with the main function. First registers x29 and x30 iare stored on the stack and SP is moved to x29. 0000000000080088 <main>: int main()
{ 80088: a9be7bfd stp x29, x30, [sp, #-32]! 8008c: 910003fd mov x29, sp Then arguments are prepared for calling the function find_lower_int . Before calling the function, values 2 and 6 are moved to registers w0 and w1 . If you recall from Chapter 9: Functions , registers w0 through w7 are used to pass arguments to functions and w0 is used to return a value from the function. int lower_int_val = find_lower_int(2, 6); 80090: 528000c1 mov w1, #0x6 // #6 80094: 52800040 mov w0, #0x2 // #2 The function find_lower_int is called using bl instruction. Finally the return value from the function which is placed in GPR x0 is stored to stack at offset 0x28. 80098: 97fffff0 bl 80058 <find_lower_int> 8009c: b9001fe0 str w0, [sp, #28] This code loads back the value from stack to GPR x0 and calls the uart_print_num function to print the value in UART. uart_print_num(lower_int_val); 800a0: b9801fe0 ldrsw x0, [sp, #28] 800a4: 940000db bl 80410 <uart_print_num>
} The above code loads back the value from stack to GPR x0 and calls the uart_print_num function to print the value in UART. 800a8: d503201f nop 800ac: a8c27bfd ldp x29, x30, [sp], #32 800b0: d65f03c0 ret Now let us us now look at the function find_lower_int that returns the lower of two integers. The sub instruction creates space for stack and following str instructions save w0 and w1 in stack at offset #12 and #8. // function returns int find_lower_int(int x, int y) { 80058: d10043ff sub sp, sp, #0x10 8005c: b9000fe0 str w0, [sp, #12] 80060: b9000be1 str w1, [sp, #8] This code loads back w1 and w0 from stack from offsets 12 and #8, effectively swapping the original value of w0 with w1 . It then compares the value of w1 with w0 and branches to location 0x8007c if value in w1 is greater than w0 value. if (x <= y) { 80064: b9400fe1 ldr w1, [sp, #12] 80068: b9400be0 ldr w0, [sp, #8] 8006c: 6b00003f cmp w1, w0 80070: 5400006c b.gt 8007c <find_lower_int+0x24> This stores the value in w0 to stack at offset #12. It then unconditionally branches to location 0x80080. // if the value of x is less than or equal to y // execute the code in this block return x; 80074: b9400fe0 ldr w0, [sp, #12] 80078: 14000002 b 80080 <find_lower_int+0x28> This loads register w0 from stack at offset #8. } else { // if the condition above is false // execute code in this block return y; 8007c: b9400be0 ldr w0, [sp, #8] }
} It finally adjusts the stack by 0x10 to remove the space it had allocated for itself at the start of the function. 80080: 910043ff add sp, sp, #0x10 80084: d65f03c0 ret You would have noticed, with -O0 option that we had used to disable optimizations makes the generated code very verbose. It forces the generated assembly code to make use of many unnecessary stack operations to save and restore intermediate results. At the same time, using a higher optimization level like -O3 would make it hard to relate the C statements with generated disassembly. For example, here is the if-else example from above compiled with -O1 . Use the command line below to to compile: aarch64-none-elf-gcc -O1 -ffreestanding -nostdinc -nostdlib -nostartfiles -I../include/ \
-c if_else_example.c -o if_else_example.o Let us first look at the disassembly output of the main function: 0000000000000000 <main>: int main()
{ 0:	a9bf7bfd stp	x29, x30, [sp, #-16]! int lower_int_val = find_lower_int(2, 6); uart_print_num(lower_int_val); 4:	d2800040 mov	x0, #0x2 // #2 8:	910003fd mov	x29, sp uart_print_num(lower_int_val); c:	94000000 bl	0 <uart_print_num> 10:	a8c17bfd ldp	x29, x30, [sp], #16 14:	d65f03c0 ret Compilers are capable of performing fairly advanced optimizations. Here, the compiler appears to have intelligently figured out that 0x2 is lower that 0x6 and moves value 0x2 to register x0 , thereby completely avoiding the need to perform call to find_lower_int function!! It was able to do this because we passed 2 and 6 as literal values. So the compiler figured out that in this instance the output of find_lower_int() will always be 2. Let us now see the code for find_lower_int function: 0000000000000000 <find_lower_int>: } else { // if the condition above is false // execute code in this block return y; }
} 0:	6b01001f cmp	w0, w1 4:	1a81d000 csel	w0, w0, w1, le 8:	d65f03c0 ret Although, the main function completely avoided call to find_lower_int function, the compiler has still generates code for the find_lower_int function so that it can honour calls from any other function that could not be optimized. It chooses to perform the entire functionality by using the csel instruction and returns the result in x0 to its caller. As an exercise, you can try generating just the disassenbly output without interleaving source code for this example. At -O0 the compiler generates very verbose code with a lot of unnecessary loads and stores. At higher optimization levels it could completely remove C code. This is a good thing in the real world but not useful when we want to show readers examples of what C code looks like when compiled. Therefore, for the remaining examples, we will use an optimization level that helps illustrate the point we want to convey.

