In the C programming language large programs can be organized into smaller, reusable blocks of code called functions. The one C function all programs must have is the main function. This is where every program starts execution. The syntax of a function is return_type function_name( parameters ) { /* Code inside function */ }. The return type must be a standard C data type or a struct or enum (we will cover them later). If the function returns no value then the return type must be specified as void . In the event no return type is specified then the compiler assumes it to be int . The code inside a function is contained within curly braces. Examples of functions: // These are examples of functions not a full working program. // That is why there is no main(). void function1() { int x = 2; char y = 'i'; uart_puts("Value of x is: "); uart_print_num(x); uart_puts("Value of y is: "); uart_puts(y);
