A related concept to arrays is pointers. In the desciption of arrays above we said that the name of the array points to the memory location of the start of the array . What that means is the array name ( scores ) hold the address of the memory location where the first element of the array is stored. We can define pointer variables of other types - int, char, and float - that hold the address of the memory location holding the data. Memory in (most) computers is byte addressable. This means that every byte (8-bits) of memory in the machine has an address. When the programmer defines a variable in C, the compiler allocates the appropriate size required at a specific location in memory. So int x; in a program instructs the compiler to reserve 8-bytes somewhere in memory. It also informs the compiler that we will be referring to this memory location in our program using the name x . Note that the programmer does not have the ability to specify where in memory those 8-bytes should be stored. The compiler decides the actual address to allocate and will allocate 8 contiguous bytes of memory for the variable x . In the C programming language pointers are used to refer to the memory location of variables. In the code below we define a int variable x and initialize it with a value. The second line declares y as a pointer of type int . This means that y is now a variable that is intended to hold the address of another variable. In the third line we assign the address of x to y . Note that &x means "address of x". The very last statement we use *y to access the contents of the memory address pointed to by y . Since y is an integer (8-bytes) this means we are telling the compiler to interpret the 8 bytes starting from the address contained in y as an integer and pass it to uart_print_num. int x = 2; // integer
int *y; // pointer to an integer
y = &x; // assign the address of x to the pointer y uart_print_num(x); // this will print 2
uart_print_num(y); // this will print the address of x // This will print the contents of the memory location pointed to by y. // That memory location is also known in this program as x.
uart_print_num(*y); //this will print 2 It is improtant to note that a pointer is useful only when it points to a valid location in memory . For example if we had not assigned y to &x then it will contain an arbitrary value (not always 0). This means that when we later dereference y by using *y we will be attempting to access memory contents that may or may not be part of our program. Just like accessing memory beyond the array bounds, this can also lead to bugs (including serious security bugs) and crashes. It is up to the programmer to ensure that pointers in the program always point to valid and intended memory locations. This may seem interesting (or complex) but how are pointers useful? One way they are useful is to allow functions to manipulate data rather than copy of a data. When we pass a parameter to a function, behind the scenes, a copy of the value is created and the function sees the copy. void some_fn(int y) { y = y * 2;
} void main() { int x = 5; some_fn(x); uart_print_num(x); // what will be printed?
} In the example above we pass a int to the function some_fn. No this creates a copy of the contents of variable x and gives that copy to the function via the stack (we will see more about that shortly). Inside some_fn we are using a copy of x . Note that even if the function was defined as void some_fn(int x) the x parameter used inside the function and the one in main are different memory locations that jusy happen to have the same name. Changing the value of a parameter passed this way will not change the original. So any changes insde some_fn will not affect the value of x in main. The last statement in main will print 5. However, if we rewrite the code so that some_fn is passed a int * instead of an integer then instead of a copy the address of x will be passed. Here is that code: void some_fn(int *y) { *y = *y * 2;
} void main() { int x = 5; some_fn(&x); uart_print_num(x); // what will be printed?
} Note that there are two changes from the earlier version. The signature of the function is now some_fn(int *y). Also, when we call this function we are passing it the address of x using the syntax &x. Inside the function we tell the compiler to multiply the contents of the integer at address y and multiply that by 2. The result is then stored in the memory addres pointed to by y. Since we are operating on the "memory address of x" (also known as y inside some_fn) the actual contents of the variable x will now be changed. The final print statement will print 10. That was a whirlwind tour of arrays and pointers. Now that we know a little about them let us practice using them by doing a few programming exercises.

